import './index.css'

const Hero = () => {
  return (
    <div id="hero">
      <div className="overlay"></div>
      <div className="blur"></div>
      <div id="hero-image">
        <img src="../static/hero.png" alt="profile"/>
      </div>
    </div>
    )
}

export default Hero;
